import logo from './logo.svg';
import './App.css';
import { RoundedCorner } from '@material-ui/icons';

function App() {
  return (
    <div className='App'>
      <Router>
        <Route>
          <Route path='/' element={<Home />} />
          <Route path='/projects' element={<Projects />} />
          <Route path='/experience' element={<Experience />} />
        </Route>
      </Router>
    </div>
  );
}

export default App;
